webpackJsonp([0x6310af1053d0],{7554:function(e,t){e.exports={data:{post:{html:'<p>For NBC, the Olympic figure skating final is <a href="http://sports.yahoo.com/olympics/torino2006/news?slug=km-nbcfigs022306&prov=yhoo&type=lgns" title="The big show - Turin 2006 Winter Olympics - Yahoo! Sports">the big show</a>, almost as big as the Super Bowl. For the German TV network ZDF it\'s no show at all. Olympic programming this evening has been pre-empted for live coverage of <a href="http://www.zdf.de/ZDFde/einzelsendung/6/0,1970,2650470,00.html" title="ZDF.de - Einzelsendung"><em>Karneval</em> in Cologne</a>. Figure skating fans here have to wait for the late night wrapup... or switch to <a href="http://eurosport.com/" title="Eurosport - The torino winter olympics live and in video">Eurosport</a>, where the Olympic coverage is better anyway. </p>',fields:{title:"Clowns instead of Figure Skating",date:"23 Feb 2006",url:"https://papascott.de/2006-02-23-clowns-instead-of-figure-skating/"}}},pathContext:{slug:"/2006-02-23-clowns-instead-of-figure-skating/",prev:{fields:{title:"Two Great Hypes That Go Great Together",date:"21 Feb 2006",slug:"/2006-02-21-two-great-hypes-that-go-great-together/"}},next:{fields:{title:"Dear Elena",date:"23 Feb 2006",slug:"/2006-02-23-dear-elena/"}}}}}});
